import React from 'react';
import styles from './Home.module.scss';

const Home = () => {
  return (
    <div className={styles.home}>
      <h1>Welcome to ClassInsight</h1>
      <p>Your dashboard for smarter learning insights.</p>
    </div>
  );
};

export default Home;
